import Nav from "./Nav";
import Hero from "./Hero";
import CTA from "./CTA";
import Info from "./Info";
import Past from "./Past";
import Sponsors from "./Sponsors";

export default function App() {
  return (
    <div>
      <Nav />
      <Hero />
      <CTA />
      <Info />
      <Past />
      <Sponsors />
    </div>
  );
}
